import React from "react";

const Modal = ({ selected }) => {
  return (
    <>
      <div className="overlay">
        {selected === "compare" && (
          <div className="compare">
            <div className="comparison-list">
              <div className="container-fluid"></div>
            </div>
          </div>
        )}
      </div>
    </>
  );
};

export default Modal;
